In the backwards direction, suppose that the displayed relation holds. We
  show naturality in D; naturality in C is similar. Suppose d\xrightarrow {k}d'
  and Fc\xrightarrow {f^\sharp } d are given. Then by construction, the following
  square commutes:




    \usepackage{tikz, tikz-cd, mathtools, amssymb}
